INSERT INTO pages VALUES(1,1,'Landing Page Test',replace('<html lang=en><head>\n  <title>COMAPNY Phishing</title>\n  <link rel=stylesheet href=https://maxcdn.bootstrapcdn.com/bootstrap/3.3.7/css/bootstrap.min.css/>\n  <style>\n  .header{\n    background-color: #000;\n  }\n  .navLink{\n    display: inline-block;\n    padding-top: 10px;\n    padding-bottom: 10px;\n    padding-left: 20px;\n    padding-right: 20px;\n  }\n  b{\n    color:#EF5350;\n  }\n  </style>\n</head>\n<body>\n  <div class=header style=text-align:left;>\n    <div class=navLink><h3 style=margin:0;><img src=companyImageSrc height=50/><b> Phishing Test</b></h3></div>\n  </div>\n  <div class=container style=text-align:center>\n    <div class=jumbotron>\n      <h2>You clicked on a simulated phishing test.</h2>\n      <h3>Here are some tips to help you stay safer in the future</h3>\n    </div>\n    <div class=row>\n      <div class=col-md-4><h1>Tip: #1</h1>\n        <h2>Stop, Look, Think</h2>\n        <p>Did anything look out of the ordinary? Did you recognize the senders address? Was it similar but not the same as an offical email?</p>\n        <pre><p style=font-size:1.2em;>Information Technology &lt;it@company.<font color=red>co</font>&gt;</p></pre>\n      </div>\n      <div class=col-md-4><h1>Tip: #2</h1>\n        <h2>Do you spot a red flag?</h2>\n        <p>At COMAPNY any email from an external sender should have a caution message at the very top. Do you see this banner?</p>\n        <img src=companyImgSrc width=100%/>\n      </div>\n      <div class=col-md-4><h1>Tip: #3</h1>\n        <h2>When in doubt throw it out</h2>\n        <p>If you ever think that an email is suspicous it is better to err on the side of caution. Forward it to phish@COMPANY.com</p>\n      </div>\n    </div>\n\n</div></body></html>','\n',char(10)),'2020-06-23 14:04:19.0843563+00:00',1,1,'https://www.youtube.com/watch?v=oHg5SJYRHA0');
