PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE goose_db_version (
                id INTEGER PRIMARY KEY auto_increment,
                version_id INTEGER NOT NULL,
                is_applied INTEGER NOT NULL,
                tstamp TIMESTAMP DEFAULT (datetime('now'))
            );
CREATE TABLE IF NOT EXISTS users (id integer primary key auto_increment,username varchar(255) NOT NULL UNIQUE,hash varchar(255),api_key varchar(255) NOT NULL UNIQUE , role_id INTEGER);
CREATE TABLE IF NOT EXISTS templates (id integer primary key auto_increment,user_id bigint,name varchar(255),subject varchar(255),text varchar(255),html varchar(255),modified_date datetime );
CREATE TABLE IF NOT EXISTS targets (id integer primary key auto_increment,first_name varchar(255),last_name varchar(255),email varchar(255),position varchar(255) );
CREATE TABLE IF NOT EXISTS results (id integer primary key auto_increment,campaign_id bigint,user_id bigint,r_id varchar(255),email varchar(255),first_name varchar(255),last_name varchar(255),status varchar(255) NOT NULL ,ip varchar(255),latitude real,longitude real , position VARCHAR(255), send_date DATETIME, reported boolean default 0, modified_date DATETIME);
CREATE TABLE IF NOT EXISTS pages (id integer primary key auto_increment,user_id bigint,name varchar(255),html varchar(255),modified_date datetime , capture_credentials BOOLEAN, capture_passwords BOOLEAN, redirect_url VARCHAR(255));
CREATE TABLE IF NOT EXISTS groups (id integer primary key auto_increment,user_id bigint,name varchar(255),modified_date datetime );
CREATE TABLE IF NOT EXISTS group_targets (group_id bigint,target_id bigint );
CREATE TABLE IF NOT EXISTS events (id integer primary key auto_increment,campaign_id bigint,email varchar(255),time datetime,message varchar(255) , details BLOB);
CREATE TABLE IF NOT EXISTS campaigns (id integer primary key auto_increment,user_id bigint,name varchar(255) NOT NULL ,created_date datetime,completed_date datetime,template_id bigint,page_id bigint,status varchar(255),url varchar(255) , smtp_id bigint, launch_date DATETIME, send_by_date DATETIME, cron_schedule varchar(255));
CREATE TABLE IF NOT EXISTS attachments (id integer primary key auto_increment,template_id bigint,content varchar(255),type varchar(255),name varchar(255) );
CREATE TABLE smtp(
	id integer primary key auto_increment,
	user_id bigint,
	interface_type varchar(255),
	name varchar(255),
	host varchar(255),
	username varchar(255),
	password varchar(255),
	from_address varchar(255),
	modified_date datetime default CURRENT_TIMESTAMP,
	ignore_cert_errors BOOLEAN
);
CREATE TABLE headers(
	id integer primary key auto_increment,
	key varchar(255),
	value varchar(255),
	smtp_id bigint
);
CREATE TABLE IF NOT EXISTS mail_logs (
    id integer primary key auto_increment,
    campaign_id integer,
    user_id integer,
    send_date datetime,
    send_attempt integer,
    r_id varchar(255),
    processing boolean);
CREATE TABLE IF NOT EXISTS email_requests (
    id integer primary key auto_increment,
    user_id integer,
    template_id integer,
    page_id integer,
    first_name varchar(255),
    last_name varchar(255),
    email varchar(255),
    position varchar(255),
    url varchar(255),
    r_id varchar(255),
    from_address varchar(255)
);
CREATE TABLE IF NOT EXISTS roles (
    id          INTEGER PRIMARY KEY auto_increment,
    slug        VARCHAR(255) NOT NULL UNIQUE,
    name        VARCHAR(255) NOT NULL UNIQUE,
    description VARCHAR(255)
);
CREATE TABLE IF NOT EXISTS permissions (
    id          INTEGER PRIMARY KEY auto_increment,
    slug        VARCHAR(255) NOT NULL UNIQUE,
    name        VARCHAR(255) NOT NULL UNIQUE,
    description VARCHAR(255)
);
CREATE TABLE IF NOT EXISTS role_permissions (
    role_id       INTEGER NOT NULL,
    permission_id INTEGER NOT NULL
);
DELETE FROM sqlite_sequence;
COMMIT;
